import{_ as e,o as s,c as a,a as o}from"./app.ca342642.js";const m=JSON.parse('{"title":"ROS Notes","description":"","frontmatter":{},"headers":[{"level":2,"title":"Communication","slug":"communication","link":"#communication","children":[{"level":3,"title":"Topic ( Talker and Listener )","slug":"topic-talker-and-listener","link":"#topic-talker-and-listener","children":[]},{"level":3,"title":"Service","slug":"service","link":"#service","children":[]},{"level":3,"title":"Action","slug":"action","link":"#action","children":[]},{"level":3,"title":"Parameters","slug":"parameters","link":"#parameters","children":[]},{"level":3,"title":"Comparison","slug":"comparison","link":"#comparison","children":[]}]},{"level":2,"title":"Launch","slug":"launch","link":"#launch","children":[]},{"level":2,"title":"Useful ROS Tool","slug":"useful-ros-tool","link":"#useful-ros-tool","children":[{"level":3,"title":"rostopic","slug":"rostopic","link":"#rostopic","children":[]},{"level":3,"title":"rosbag","slug":"rosbag","link":"#rosbag","children":[]},{"level":3,"title":"rqt","slug":"rqt","link":"#rqt","children":[]}]},{"level":2,"title":"Build ROS packages","slug":"build-ros-packages","link":"#build-ros-packages","children":[{"level":3,"title":"Overlay","slug":"overlay","link":"#overlay","children":[]},{"level":3,"title":"Environment Variable \u74B0\u5883\u8B8A\u6578","slug":"environment-variable-\u74B0\u5883\u8B8A\u6578","link":"#environment-variable-\u74B0\u5883\u8B8A\u6578","children":[]},{"level":3,"title":"Reference for ROS","slug":"reference-for-ros","link":"#reference-for-ros","children":[]}]}],"relativePath":"notes/misc/ros-notes.md"}'),l={name:"notes/misc/ros-notes.md"},r=o(`<h1 id="ros-notes" tabindex="-1">ROS Notes <a class="header-anchor" href="#ros-notes" aria-hidden="true">#</a></h1><h2 id="communication" tabindex="-1">Communication <a class="header-anchor" href="#communication" aria-hidden="true">#</a></h2><ul><li>Node <blockquote><p>ROS \u88E1\u6700\u5C0F\u7684\u55AE\u4F4D</p></blockquote></li><li>Topic ( Publisher / Subscriber ) <blockquote><p>\u53EA\u80FD\u505A\u55AE\u65B9\u9762\u7684\u767C\u5E03\u3001\u63A5\u6536</p></blockquote></li><li>Service ( Server / Client ) <blockquote><p>\u96D9\u5411\uFF0C\u6703\u66AB\u505C\u76F4\u5230\u6536\u5230\u5C0D\u65B9\u56DE\u61C9</p></blockquote></li><li>Action ( Server / Client ) <blockquote><p>\u96D9\u5411\uFF0C\u4E2D\u9593\u53EF\u63A5\u6536 feedback</p></blockquote></li><li>Parameter Server <blockquote></blockquote></li></ul><p><img src="https://i.imgur.com/eHX8VBn.png" alt=""></p><h3 id="topic-talker-and-listener" tabindex="-1">Topic ( Talker and Listener ) <a class="header-anchor" href="#topic-talker-and-listener" aria-hidden="true">#</a></h3><ul><li><code>roscore</code>\uFF1A\u958B\u555F master <blockquote><p>\u5982\u679C\u6C92\u6709\u958B\u555F\u7684\u8A71\uFF0Cnode \u5F7C\u6B64\u7121\u6CD5\u6E9D\u901A\u3002<br> roscore \u5728\u4E00\u500B\u7DB2\u57DF\u4E2D\u53EA\u80FD\u540C\u6642\u6709\u4E00\u500B\uFF01</p></blockquote></li></ul><p><img src="https://i.imgur.com/gXDo79C.png" alt=""></p><ul><li><code>rosrun roscpp_tutorials talker</code>\uFF1A\u57F7\u884C talker node</li><li><code>rosrun roscpp_tutorials listener</code>\uFF1A\u57F7\u884C listener node <blockquote><p>talker \u548C listener \u662F package\uFF1Aroscpp_tutorials \u5167\u5EFA\u7684</p></blockquote></li><li><code>rosnode list</code>\uFF1A\u5217\u51FA\u76EE\u524D\u6240\u6709 node</li><li><code>rosnode info &lt;node_name&gt;</code>\uFF1A\u5217\u51FA node \u7684\u8A73\u7D30\u8CC7\u8A0A</li><li><code>rostopic list</code>\uFF1A\u5217\u51FA\u76EE\u524D\u6240\u6709\u7684 topic</li><li><code>rostopic hz /&lt;node_name&gt;</code>\uFF1A\u5217\u51FA topic \u767C\u9001\u7684\u983B\u7387</li><li><code>rostopic info &lt;topic_name&gt;</code>\uFF1A\u5217\u51FA topic \u7684\u8A73\u7D30\u8CC7\u8A0A</li><li><code>rosmsg show std_mags/&lt;msg_name&gt;</code>\uFF1A\u5217\u51FA msg \u7684\u578B\u5225\u548C\u8B8A\u6578\u540D\u7A31</li><li><code>rosnode ping /&lt;node&gt;</code>\uFF1A\u6E2C\u8A66 node \u662F\u5426\u5B58\u5728 <blockquote><p>\u82E5\u4E0D\u5B58\u5728\u3001\u95DC\u9589\u6B64 node\uFF0C\u5247\u6703\u51FA\u73FE <code>cannot ping [/&lt;node&gt;]: unknown node</code></p></blockquote></li></ul><h3 id="service" tabindex="-1">Service <a class="header-anchor" href="#service" aria-hidden="true">#</a></h3><h4 id="request-response-communication" tabindex="-1">Request &amp; Response Communication <a class="header-anchor" href="#request-response-communication" aria-hidden="true">#</a></h4><p><img src="https://i.imgur.com/25HuvPP.png" alt=""></p><ul><li><code>rosservice list</code>\uFF1A\u5217\u51FA\u76EE\u524D\u53EF\u7528\u7684 service</li><li><code>rosservice type /&lt;service_name&gt;</code>\uFF1A\u5217\u51FA service \u7684\u578B\u5225</li><li><code>rosservice call /&lt;service_name&gt; &lt;args&gt;</code>\uFF1A\u547C\u53EB service <blockquote><p>args \u70BA\u6839\u64DA\u5B9A\u7FA9\u6240\u9700\u8981\u7684\u53C3\u6578</p></blockquote></li></ul><h4 id="service-definition" tabindex="-1">Service Definition <a class="header-anchor" href="#service-definition" aria-hidden="true">#</a></h4><p>\u526F\u6A94\u540D\uFF1A<code>.srv</code></p><div class="language- line-numbers-mode"><button class="copy"></button><span class="lang"></span><pre><code><span class="line"><span style="color:#A6ACCD;">&lt;request&gt;</span></span>
<span class="line"><span style="color:#A6ACCD;">---</span></span>
<span class="line"><span style="color:#A6ACCD;">&lt;response&gt;</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div><p>\u7BC4\u4F8B\uFF1A</p><div class="language- line-numbers-mode"><button class="copy"></button><span class="lang"></span><pre><code><span class="line"><span style="color:#A6ACCD;">geometry_msgs/PoseStamped start</span></span>
<span class="line"><span style="color:#A6ACCD;">geometry_msgs/PoseStamped goal</span></span>
<span class="line"><span style="color:#A6ACCD;">float32 tolerance</span></span>
<span class="line"><span style="color:#A6ACCD;">---</span></span>
<span class="line"><span style="color:#A6ACCD;">nav_msgs/Path plan</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div><h4 id="example" tabindex="-1">Example <a class="header-anchor" href="#example" aria-hidden="true">#</a></h4><ol><li><code>roscore</code>\uFF1A\u958B\u555F master</li><li><code>rosrun roscpp_tutorials add_two_ints_server</code>\uFF1A\u57F7\u884C\u6B64 server</li><li><code>rosservice list</code>\uFF1A\u5217\u51FA\u76EE\u524D\u53EF\u7528\u7684 service</li><li><code>rosservice type /add_two_ints</code>\uFF1A\u5217\u51FA service \u7684\u578B\u5225</li><li><code>rossrv show roscpp_tutorials/TwoInts</code>\uFF1A\u67E5\u770B Service Definition</li><li><code>rosservice call /add_two_ints &quot;a: 10 b: 5&quot;</code>\uFF1A\u547C\u53EB service</li></ol><blockquote><p>\u4E0D\u77E5\u9053\u53C3\u6578\u578B\u614B\uFF0C\u53EF\u5728\u6700\u5F8C\u6309\u300Ctab\u300D\u7372\u5F97\u63D0\u793A \u57F7\u884C <code>rosrun roscpp_tutorials add_two_ints_server</code> \u7684 Terminal \u4E5F\u6703\u7372\u5F97\u8CC7\u8A0A</p></blockquote><h3 id="action" tabindex="-1">Action <a class="header-anchor" href="#action" aria-hidden="true">#</a></h3><ol><li>Request &amp; Response with</li></ol><ul><li>Cancel the task ( preempt )</li><li>Receive feedback on the progress</li></ul><ol start="2"><li>Suitable to the scenario while <strong>response time is too long</strong></li><li>Implemented with several topics</li></ol><p><img src="https://i.imgur.com/9XOTKK1.png" alt=""></p><h4 id="action-definition" tabindex="-1">Action Definition <a class="header-anchor" href="#action-definition" aria-hidden="true">#</a></h4><p>\u526F\u6A94\u540D\uFF1A<code>.action</code></p><div class="language- line-numbers-mode"><button class="copy"></button><span class="lang"></span><pre><code><span class="line"><span style="color:#A6ACCD;">&lt;goal&gt;</span></span>
<span class="line"><span style="color:#A6ACCD;">---</span></span>
<span class="line"><span style="color:#A6ACCD;">&lt;result&gt;</span></span>
<span class="line"><span style="color:#A6ACCD;">---</span></span>
<span class="line"><span style="color:#A6ACCD;">&lt;feedback&gt;</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div><p>\u7BC4\u4F8B\uFF1A</p><div class="language- line-numbers-mode"><button class="copy"></button><span class="lang"></span><pre><code><span class="line"><span style="color:#A6ACCD;">navigation_msgs/Path path</span></span>
<span class="line"><span style="color:#A6ACCD;">---</span></span>
<span class="line"><span style="color:#A6ACCD;">bool success</span></span>
<span class="line"><span style="color:#A6ACCD;">---</span></span>
<span class="line"><span style="color:#A6ACCD;">float32 remaining_distance</span></span>
<span class="line"><span style="color:#A6ACCD;">float32 initial_distance</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br></div></div><h4 id="example-1" tabindex="-1">Example <a class="header-anchor" href="#example-1" aria-hidden="true">#</a></h4><ol><li><code>roscore</code></li><li><code>rosrun actionlib_tutorials fibonacci_server</code></li><li><code>rosrun actionlib_tutorials fibonacci_client</code></li><li><code>rostopic list</code>\uFF1A\u5217\u51FA\u76EE\u524D\u7684 topic</li><li><code>rostopic echo /fibonacci/status</code>\uFF1A\u5217\u51FA status</li><li><code>rostopic echo /fibonacci/feedback</code>\uFF1A\u5217\u51FA feedback</li></ol><h3 id="parameters" tabindex="-1">Parameters <a class="header-anchor" href="#parameters" aria-hidden="true">#</a></h3><ol><li>ROS provides Parameter Server for nodes</li><li>ROS node can store/retrieve parameter from server at runtime</li><li>rosparam is the CLI tools for Parameter Server</li></ol><ul><li><code>rosparam list</code>\uFF1A\u5217\u51FA parameters</li><li><code>rosparam set &lt;parameter&gt; &lt;value&gt;</code>\uFF1A\u8A2D\u5B9A\u8B8A\u6578</li><li><code>rosparam get /&lt;parameter&gt;</code>\uFF1A\u5217\u51FA\u8B8A\u6578\u7684\u5167\u5BB9</li><li><code>rosparam dump</code>\uFF1A\u5217\u51FA\u6240\u6709 parameters \u7684\u5167\u5BB9</li></ul><h3 id="comparison" tabindex="-1">Comparison <a class="header-anchor" href="#comparison" aria-hidden="true">#</a></h3><p>Topic \u55AE\u65B9\u5411\u3001\u9023\u7E8C\u5C07\u8CC7\u6599\u50B3\u9001\u7D66\u5C0D\u65B9 Service \u505C\u4E0B\u4F86\u7B49\u5F85\u56DE\u61C9 <img src="https://i.imgur.com/VAH8H19.png" alt=""></p><h2 id="launch" tabindex="-1">Launch <a class="header-anchor" href="#launch" aria-hidden="true">#</a></h2><ol><li>Able to launch multiple ROS nodes and set parameters easily</li><li>It\u2019ll start roscore if no roscore</li><li>\u526F\u6A94\u540D\uFF1A<code>.launch</code></li></ol><p>\u7BC4\u4F8B\uFF1A</p><div class="language- line-numbers-mode"><button class="copy"></button><span class="lang"></span><pre><code><span class="line"><span style="color:#A6ACCD;">&lt;launch&gt;</span></span>
<span class="line"><span style="color:#A6ACCD;">    &lt;node name=&quot;listener&quot; pkg=&quot;roscpp_tutorials&quot; type=&quot;listener&quot; output=&quot;screen&quot;/&gt;</span></span>
<span class="line"><span style="color:#A6ACCD;">    &lt;node name=&quot;talker&quot; pkg=&quot;roscpp_tutorials&quot; type=&quot;talker&quot; output=&quot;screen&quot;/&gt;</span></span>
<span class="line"><span style="color:#A6ACCD;">&lt;/launch&gt;</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div><ul><li><code>roslaunch roscpp_tutorials talker_listener.launch</code>\uFF1A \u57F7\u884C\u6B64 launch \u6A94\u6848 ( \u6703\u81EA\u52D5 <code>roscore</code> ) <blockquote><p>\u6307\u4EE4\u5167\u5BB9\u7D50\u69CB\uFF1A<code>roslaunch &lt;package&gt; &lt;file.launch&gt;</code></p></blockquote></li></ul><h2 id="useful-ros-tool" tabindex="-1">Useful ROS Tool <a class="header-anchor" href="#useful-ros-tool" aria-hidden="true">#</a></h2><h3 id="rostopic" tabindex="-1">rostopic <a class="header-anchor" href="#rostopic" aria-hidden="true">#</a></h3><ol><li><strong>Latching mode</strong><blockquote><p>Rostopic will publish a message to <code>/topic_name</code> and keep it latched -- any new subscribers that come online after you start rostopic will hear this message. You can stop this at any time by pressing <code>ctrl-C</code>.<br> Rostopic \u5C07\u5411 <code>/topic_name</code> \u767C\u5E03\u8A0A\u606F\u4E26\u4FDD\u6301\u9396\u5B9A \u2014\u2014 \u4EFB\u4F55\u555F\u52D5 rostopic \u5F8C\u4E0A\u7DDA\u7684\u65B0 subscribers \u90FD\u6703\u807D\u5230\u6536\u5230\u9019\u5247\u8A0A\u606F\u3002<br><code>rostopic pub -l /chatter std_msgs/String &quot;data: &#39;test&#39;&quot;</code></p></blockquote></li><li><strong>Once mode</strong><blockquote><p>If you don&#39;t want to have to stop rostopic with <code>ctrl-C</code>, you can publish in once mode. <br> rostopic will keep the message latched.<br> \u5982\u679C\u4E0D\u60F3\u7528\u4E2D\u65B7 rostopic\uFF0C\u53EF\u9078\u64C7 Once mode \u4E0B\u767C\u5E03\u3002<br> rostopic \u5C07\u9396\u5B9A\u8A0A\u606F 3 \u79D2\u5F8C\u9000\u51FA\u3002<br><code>rostopic pub -1 /chatter std_msgs/String &quot;data: &#39;test&#39;&quot;</code></p></blockquote></li><li><strong>Rate mode</strong><blockquote><p>In rate mode, rostopic will publish your message at a specific rate. For example, -r 10 will publish at 10hz. For file and piped input, this defaults to 10hz.<br> \u5728 Rate mode \u4E0B\uFF0Crostopic \u5C07\u4EE5\u7279\u5B9A\u901F\u7387\u767C\u5E03\u8A0A\u606F\u3002<br><code>rostopic pub -r 10 /chatter std_msgs/String &quot;data: &#39;test&#39;&quot;</code></p></blockquote></li></ol><h3 id="rosbag" tabindex="-1">rosbag <a class="header-anchor" href="#rosbag" aria-hidden="true">#</a></h3><ol><li>Record, Replay and Debug \u9304\u88FD\u3001\u91CD\u64AD\u3001\u5075\u932F</li><li>network =&gt; wireshark</li><li>ROS =&gt; rosbag</li></ol><ul><li><code>rosbag record --all</code>\uFF1Arecord \u5168\u90E8\u7684 topic</li><li><code>rosbag record /&lt;topic&gt;</code>\uFF1Arocord \u7279\u5B9A\u7684 topic</li><li><code>rosbag info &lt;rosbag_filename&gt;.bag</code>\uFF1A\u5217\u51FA file.bag \u7684\u8CC7\u8A0A</li><li><code>rosbag play &lt;rosbag_filename&gt;.bag</code>\uFF1A\u64AD\u653E file.bag \u7684\u9304\u88FD\u5167\u5BB9</li></ul><h3 id="rqt" tabindex="-1">rqt <a class="header-anchor" href="#rqt" aria-hidden="true">#</a></h3><p>\u5716\u5F62\u5316\u4ECB\u9762\u5DE5\u5177</p><ul><li><code>rqt</code>\uFF1A\u958B\u555F rqt</li><li><code>rqt_graph</code>\uFF1A\u958B\u555F rqt \u4E26\u6253\u958B node graph <blockquote><p>\u85CD\u8272\u70BA Publisher\u3001\u7DA0\u8272\u70BA Subscriber\u3001\u7D05\u8272\u5247\u70BA Topic</p></blockquote></li></ul><h2 id="build-ros-packages" tabindex="-1">Build ROS packages <a class="header-anchor" href="#build-ros-packages" aria-hidden="true">#</a></h2><p><img src="https://i.imgur.com/LHV0oLm.png" alt=""></p><ul><li><p><strong>Workspace</strong></p><ul><li><strong>src</strong>\uFF1A\u653E\u7A0B\u5F0F\u78BC</li><li><strong>build</strong> ( \u7531 catkin_make \u81EA\u52D5\u5275\u5EFA )</li><li><strong>devel</strong> ( \u7531 catkin_make \u81EA\u52D5\u5275\u5EFA )</li></ul></li><li><p><code>mkdir -p ~/&lt;workspace_name&gt;/src</code>\uFF1A\u5275\u5EFA workspace</p></li><li><p><code>cd ~/&lt;workspace_name&gt;/src</code>\uFF1A\u79FB\u52D5\u5230 workspace/src</p></li><li><p><code>git clone https://github.com/ros/ros_tutorials.git</code></p></li><li><p><code>cd ~/&lt;workspace_name&gt;</code>\uFF1A\u79FB\u52D5\u5230 workspace</p></li><li><p><code>catkin_make</code>\uFF1A\u5EFA\u7ACB packages</p></li></ul><h3 id="overlay" tabindex="-1">Overlay <a class="header-anchor" href="#overlay" aria-hidden="true">#</a></h3><ul><li><code>cd ~/&lt;workspace_name&gt;</code>\uFF1A\u79FB\u52D5\u5230 workspace</li><li><code>rospack list | grep rospy_tutorials</code>\uFF1A\u5217\u51FA rospy_tutorials \u7684 package</li><li><code>echo $ROS_PACKAGE_PATH</code>\uFF1A\u986F\u793A ROS system&#39;s packages \u8DEF\u5F91<br></li></ul><p>Setup the package environment by overlay</p><blockquote><p><code>source devel/setup.bash</code> \u8986\u84CB</p></blockquote><ul><li><code>rospack list | grep rospy_tutorials</code></li><li><code>echo $ROS_PACKAGE_PATH</code></li></ul><h3 id="environment-variable-\u74B0\u5883\u8B8A\u6578" tabindex="-1">Environment Variable \u74B0\u5883\u8B8A\u6578 <a class="header-anchor" href="#environment-variable-\u74B0\u5883\u8B8A\u6578" aria-hidden="true">#</a></h3><ul><li><code>ROS_DISTRO</code>\uFF1AROS distribution, e.g. noetic</li><li><code>ROS_MASTER_URI</code>\uFF1ATell ROS node where to locate master</li><li><code>ROS_IP/ROS_HOSTNAME</code>\uFF1ANetwork Address of ROS node</li><li><code>ROS_ROOT</code>\uFF1AWhere the ROS root path is</li><li><code>ROS_PACKAGE_PATH</code>\uFF1ATell ROS system where to search the packages</li></ul><h4 id="\u6307\u4EE4" tabindex="-1">\u6307\u4EE4 <a class="header-anchor" href="#\u6307\u4EE4" aria-hidden="true">#</a></h4><ul><li><code>echo $&lt;environment_variable&gt;</code>\uFF1A\u53EF\u4EE5\u986F\u793A\u51FA\u4F86\u770B</li><li><code>ros_menu_env</code>\uFF1A\u53EF\u4EE5\u986F\u793A\u5E38\u898B\u74B0\u5883\u8B8A\u6578 ( \u50C5\u9650\u6709\u4F7F\u7528 ros menu )</li></ul><h3 id="reference-for-ros" tabindex="-1">Reference for ROS <a class="header-anchor" href="#reference-for-ros" aria-hidden="true">#</a></h3><ul><li><a href="https://www.ros.org/" target="_blank" rel="noreferrer">ROS Official Sites</a>\uFF1AROS \u5B98\u65B9\u7DB2\u7AD9</li><li><a href="https://discourse.ros.org/" target="_blank" rel="noreferrer">ROS Discourse</a>\uFF1A\u5F88\u591A\u516C\u53F8\u3001\u7814\u7A76\u55AE\u4F4D\u6703\u767C\u5E03 ROS \u76F8\u95DC\u77E5\u8B58</li><li><a href="http://wiki.ros.org/" target="_blank" rel="noreferrer">ROS Wiki</a>\uFF1A\u5B89\u88DD\u3001\u6559\u5B78\u3001\u5982\u4F55\u4F7F\u7528 API</li><li><a href="https://answers.ros.org/questions/" target="_blank" rel="noreferrer">ROS Answers</a>\uFF1A\u8DDF ROS \u6709\u95DC\u7684\u554F\u984C</li><li><a href="https://index.ros.org/packages/" target="_blank" rel="noreferrer">ROS Packages List</a></li><li><a href="https://github.com/ros" target="_blank" rel="noreferrer">ROS GitHub</a></li><li><a href="https://github.com/ros2" target="_blank" rel="noreferrer">ROS 2 GitHub</a></li><li><a href="https://www.openrobotics.org/" target="_blank" rel="noreferrer">Open Robotics</a></li><li><a href="https://github.com/ROBOTIS-GIT/ros_seminar" target="_blank" rel="noreferrer">ROS tutorial</a>\uFF1A\u4E00\u4E9B ROS \u7684\u6559\u5B78\u6559\u6750</li><li><a href="https://www.youtube.com/playlist?list=PLRE44FoOoKf7NzWwxt3W2taZ7BiWyfhCp" target="_blank" rel="noreferrer">ROS 2 tutorials for foxy</a>\uFF1AROS2 \u7684\u5F71\u7247</li><li><a href="https://github.com/adlink-ROS/" target="_blank" rel="noreferrer">ADLINK GitHub</a></li></ul>`,65),i=[r];function n(t,c,p,d,u,h){return s(),a("div",null,i)}const g=e(l,[["render",n]]);export{m as __pageData,g as default};
